import React from "react";
import QuestionLabel from "src/components/question";
import Slider from "src/components/slider";
import { Swiper, SwiperSlide } from "swiper/react";
import { useParams } from "react-router-dom";
import axios from "axios";

interface MyComponentProps {
  cart: any;
  setData: any;
  like: any;
  setLikeMock: any;
  addMock: any;
  setAddMock: any;
}

const CartPage: React.FC<MyComponentProps> = ({
  cart,
  setData,
  like,
  setLikeMock,
  addMock,
  setAddMock,
}) => {
  const { id } = useParams();
  const [card, setCard] = useState(null);

  const ShowOrderedCups = () => {
    if (cart.imgOrdered === undefined) {
      return null;
    }
    return cart.imgOrdered.map((imgUrl: string, index: number) => {
      return (
        <img
          className="CartPage__orderedImg"
          src={"img/carts/" + imgUrl}
          key={index}
        />
      );
    });
  };
  const ShowCartImg = () => {
    return cart.images.map((img: string, index: number) => {
      return (
        <SwiperSlide key={index}>
          <img className="CartPage__img" src={"img/carts/" + img} />
        </SwiperSlide>
      );
    });
  };

  const ShowCheckBoxs = () => {
    const ShowActiveBoxs = () => {
      return cart.type.map((element: any, index: number) => {
        if (element.isActive) {
          return (
            <>
              <h3 className="CartPage__checkBoxs_title">Чашка:</h3>
              <div className="CartPage__checkBoxs_active" key={index}>
                <img
                  className="CartPage__checkBoxs_img"
                  src={"img/carts/" + element.img}
                />
                <h3 className="CartPage__checkBoxs_title">{element.name}</h3>
              </div>
            </>
          );
        }
      });
    };
    const ShowOther = () => {
      return cart.type.map((element: any, index: number) => {
        return (
          <div
            className={
              element.isActive
                ? "CartPage__checkBoxs_row CartPage__checkBoxs_row--active "
                : "CartPage__checkBoxs_row "
            }
            key={index}
          >
            <img
              className="CartPage__checkBoxs_img"
              src={"img/carts/" + element.img}
            />
            <h3 className="CartPage__checkBoxs_title">{element.name}</h3>
          </div>
        );
      });
    };
    return (
      <div className="CartPage__checkBoxs_block">
        <ShowActiveBoxs />
        <div className="CartPage__checkBoxs_wrapper CartPage__checkBoxs_wrapper--active">
          <ShowOther />
        </div>
      </div>
    );
  };

  return (
    <div className="CartPage">
      <Swiper className="CartPage__slider">
        <ShowCartImg />
      </Swiper>
      <h2 className="CartPage__title">{cart.name}</h2>
      <div className="CartPage__row">
        <span className="CartPage__price">{cart.price} ₴</span>
        <span className="CartPage__oldPrice">{cart.oldPrice} ₴</span>
      </div>
      <ShowCheckBoxs />
      <div className="CartPage__row">
        <button className="CartPage__button">Замовити</button>
        <button className="CartPage__like">
          <img src="img/heart-svgrepo-com.svg" />
        </button>
      </div>
      <p
        className="CartPage__text"
        dangerouslySetInnerHTML={{ __html: cart.description }}
      ></p>
      <div className="CartPage__block">
        <h2 className="CartPage__block_title">
          Чашки, які вже замовили з цим дизайном
        </h2>
        <div className="CartPage__block_wrapper">
          <ShowOrderedCups />
        </div>
      </div>
      <QuestionLabel title="Детальніше про продукт" description={cart.about} />
      <QuestionLabel
        title="Доставка і оплата"
        description={`Оформлені до 18:00 замовлення відправляємо в той же день!\n
Доставка Новою Поштою 1-3 дні\n
Оплатити замовлення можна при отриманні на Новій пошті (*крім кастомних чашок), або по передплаті на банківський рахунок.`}
      />
      <Slider />
    </div>
  );
};
export default CartPage;
